<body style="margin: 0; padding: 0;">
<script src="{{ env('ROOT_PATH') }}/js/pdfkit.js"></script>
<script src="https://github.com/devongovett/blob-stream/releases/download/v0.1.3/blob-stream.js"></script>
<script src="https://momentjs.com/downloads/moment.js"></script>
<iframe id="iframe" src="" width="100%" height="100%" style="border: 0;"> </iframe>
<script>
    let ticketImage = "data:image/png;base64,";
    // create a document and pipe to a blob
var doc = new PDFDocument({size: [595.27584, 283.46472], margin: 0});
var stream = doc.pipe(blobStream());

fetch("{{ env('ROOT_PATH') }}/fonts/open_sans/OpenSans-Semibold.ttf")
    .then(response => response.arrayBuffer())
    .then(font => doc.registerFont('Semibold',  font));
fetch("{{ env('ROOT_PATH') }}/fonts/open_sans/OpenSans-Regular.ttf")
    .then(response => response.arrayBuffer())
    .then(font => doc.registerFont('Regular',  font));
fetch("{{ env('ROOT_PATH') }}/fonts/open_sans/OpenSans-Bold.ttf")
    .then(response => response.arrayBuffer())
    .then(font => doc.registerFont('Bold',  font));

// draw some text

let data = {!! json_encode($data) !!};

setTimeout(() => {
    for(let i = 0; i < data.tickets.length; i++) {
        if (i > 0) {
            doc.addPage();
        }

        doc.image(ticketImage, 0, 0, {width: 595.27584});

        doc.font("Semibold").fillColor("#305772").fontSize(10.68633842);
        doc.text("QEF", 14.5, 43);
        doc.text("QEF", 35, 43, { width: 50, align: "right" });
        doc.text("ETKT "+data.tickets[i].shortcode, 508, 43, { width: 77, align: "center" });

        doc.font("Semibold").fillColor("#305772").fontSize(14);
        doc.text(data.tickets[i].passenger.toUpperCase(), 102.5, 88);

        doc.font("Semibold").fillColor("#305772").fontSize(11.18492532);
        doc.text(data.slot.flight_number, 102.5, 132.5);
        doc.text("QEF", 163.5, 132.5);
        doc.text("QEF", 199, 132.5);
        doc.text(moment(data.slot.date).format("DD MMM YYYY").toUpperCase(), 235.8, 132.5);
        doc.text(moment(data.slot.boarding).format("HH:mm"), 318, 132.5);
        doc.text(data.slot.duration, 371, 132.5);

        doc.text(moment(data.tickets[i].issued_at).format("DD MMM YYYY").toUpperCase(), 235.8, 181.5);
        doc.text(data.booking.shortcode, 318, 181.5);
        doc.text(data.tickets[i].shortcode, 371, 181.5);

        doc.font("Semibold").fillColor("#305772").fontSize(23.02393484);
        doc.text(data.tickets[i].price, 101.5, 177.5);

        doc.font("Regular").fillColor("#305772").fontSize(4.70000017);
        doc.text("Egelsbach, den "+moment(data.tickets[i].issued_at).format("DD.MM.YYYY").toUpperCase(), 463, 215.6, {width: 100});

        doc.font("Bold").fillColor("#FF0000").fontSize(23.02393484);
        doc.text(data.tickets[i].special, 235.8, 215.6);

        doc.rotate(90);
        doc.image(data.tickets[i].pdf417, 77, -80, {width: 180});
        doc.rotate(-90);
    }
    doc.end();
}, 500);


// end and display the document in the iframe to the right

stream.on('finish', function() {
    iframe.src = stream.toBlobURL('application/pdf');
    iframe.onload = function() {
        iframe.focus();
        //iframe.contentWindow.print();
    }
});
</script>
</body>